pragma solidity ^0.8.0;
import "../../../interfaces/ITradeableAndIBankable.sol";

contract Tradeable is ITradeable {
    bool immutable _tradeable;
    bool immutable _onlyWithCurrency;

    function supportsInterface(bytes4 interfaceId)
        external
        pure
        returns (bool)
    {
        return interfaceId == type(ITradeable).interfaceId;
    }

    constructor(bool tradeable_, bool onlyWithCurrency_) {
        _tradeable = tradeable_;
        _onlyWithCurrency = onlyWithCurrency_;
    }

    function tradeable() external view returns (bool) {
        return _tradeable;
    }

    function onlyWithCurrency() external view returns (bool) {
        return _onlyWithCurrency;
    }
}

contract Bankeable is IBankeable {
    function supportsInterface(bytes4 interfaceId)
        external
        pure
        returns (bool)
    {
        return interfaceId == type(IBankeable).interfaceId;
    }

    bool immutable _bankeable;

    constructor(bool bankeable_) {
        _bankeable = bankeable_;
    }

    function bankeable() external view returns (bool) {
        return _bankeable;
    }
}
